script: |
  super -f text -I q7361.spq | sort > q7361.out

inputs:
  - name: q7361.spq
    data: |
      SELECT DISTINCT - col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 80 BETWEEN - col2 / + col2 + + + 2 AND - col2 * - col1 + - + 46;
  - name: tab2

outputs:
  - name: q7361.out
    data: |
